import React from "react";

function Home() {
  return (
    <React.Fragment>
         {/* <h2 className="text-primary">hi home</h2>
         <button type="button" className="btn btn-primary">Primary</button> */}
         <div className="container">
         <h1 className="text-primary fw-bold">LIST OF USERS</h1>
         <table className="table table-stripped table-hover bg-light">
            <thead>
                <th>ID</th>
                <th>NAME</th>
                <th>EMAIL</th>
                <th>PHONE</th>
            </thead>

         </table>

         </div>

    </React.Fragment>

  )
}

export default Home;
